        const getData = async ()=>{
          const response = await axios.get('https://newsapi.org/v2/top-headlines?country=us&apiKey=a612a032fc214df2962a6fcd6d4fe944')
          setData(response.data.articles);
        }
        getData();
  },[])
  console.log(data);
  return (
    <div >
        <Home data={data} />

    </div>
  )
}

